import React from 'react'

const Confirmation = ({ prevStep, nextStep, values }) => {
  
  const { estatetype, fullname, phone, email, region, district } = values
  const Continue = e => {
    e.preventDefault();
    nextStep();




    const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: {estatetype, fullname, phone, email, region, district}
    };
    fetch('/api/lead', requestOptions)
        .then(response => response.json())
        .then(data => console.log(data));
  }

  const Previous = e => {
    e.preventDefault();
    prevStep();
  }

  return (
      <div>
        <ul>
            <li>Estate type: {estatetype}</li>
            <li>Region: {region}</li>
            <li>District: {district}</li>
            <li>Full name: {fullname}</li>
            <li>Email: {email}</li>
            <li>Phone: {phone}</li>
        </ul>

        
        <button 
            onClick={ Previous }
              type="submit"
            >
              Previous
            </button>

            <button 
              onClick={ Continue }
              type="submit"
            >
              Confirm & Continue
            </button>
      </div>
  )
}

export default Confirmation
